import "./App.css";
import SectionBar from "./components/section-bar.js";
import LandingPage from "./landingPage";
import { BrowserRouter, Route, Switch } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Layout>
          <Switch>
            <Route path="/" component={LandingPage} />
          </Switch>
        </Layout>
      </BrowserRouter>

      <SectionBar />
      <LandingPage />
    </div>
  );
}

export default App;
